function DarkMode() {
    return (
        function DarkMode() {
            const backgroundColor = MyBodyColor.style.backgroundColor;
            if (backgroundColor === 'black') {
                MyBodyColor.style.backgroundColor = 'var(--mainBgcolor)';

            }
            else {
                MyBodyColor.style.backgroundColor = 'black';
            }
        }
    );
}
export default DarkMode
